/*global google*/

import React, { useEffect, useRef } from 'react';
import { useState } from 'react';
import './ScheduleItem.css';

function ScheduleItem({ isOpen, closeModal, onSave }) {
  const mapRef = useRef(null); // Ref to store the map DOM element reference
  const autocompleteRef = useRef(null); // Ref to store the Autocomplete instance

  useEffect(() => {
    function initMap() {
      const map = new google.maps.Map(mapRef.current, {
        center: { lat: 40.749933, lng: -73.98633 },
        zoom: 13,
        mapTypeControl: false,
      });
      const card = document.getElementById("pac-card");
      const input = document.getElementById("pac-input");
      const biasInputElement = document.getElementById("use-location-bias");
      const strictBoundsInputElement = document.getElementById("use-strict-bounds");
      const options = {
        fields: ["formatted_address", "geometry", "name"],
        strictBounds: false,
      };

      map.controls[google.maps.ControlPosition.TOP_LEFT].push(card);

      const autocomplete = new google.maps.places.Autocomplete(input, options);
      autocompleteRef.current = autocomplete;

      // Bind the map's bounds (viewport) property to the autocomplete object,
      // so that the autocomplete requests use the current map bounds for the
      // bounds option in the request.
      autocomplete.bindTo("bounds", map);

      const infowindow = new google.maps.InfoWindow();
      const infowindowContent = document.getElementById("infowindow-content");

      infowindow.setContent(infowindowContent);

      const marker = new google.maps.Marker({
        map,
        anchorPoint: new google.maps.Point(0, -29),
      });

      // ... (The rest of the autocomplete setup remains the same)

      // Add listener for autocomplete place_changed event
      autocomplete.addListener("place_changed", () => {
        const place = autocomplete.getPlace();

        if (!place.geometry || !place.geometry.location) {
          window.alert("No details available for input: '" + place.name + "'");
          return;
        }

        marker.setPosition(place.geometry.location);
        marker.setVisible(true);
        infowindowContent.children["place-name"].textContent = place.name;
        infowindowContent.children["place-address"].textContent =
          place.formatted_address;
        infowindow.open(map, marker);

        // 선택한 장소로 지도 이동
        if (place.geometry.viewport) {
          map.fitBounds(place.geometry.viewport);
        } else {
          map.setCenter(place.geometry.location);
          map.setZoom(17);
        }
      });
    }

    // Load Google Maps API script and call initMap() when loaded
    const script = document.createElement("script");
    script.src = `https://maps.googleapis.com/maps/api/js?key=AIzaSyAyZffxPv5S2NP2NEp_31-HH9XmDwSEWbM&callback=initMap&libraries=places&v=weekly`;
    script.defer = true;
    document.body.appendChild(script);

    // 이 부분을 useEffect 내부로 이동합니다.
    window.initMap = initMap;
  }, []);

  const [start, setStart] = useState("");
  const [startday, setStartday] = useState("");
  const [starttime, setStarttime] = useState("");
  const [endday, setEndday] = useState("");
  const [endtime, setEndtime] = useState("");

  const handleChangeStart = (event) => setStart(event.target.value);
  // ... (The rest of the handleChange functions remain the same)

  const handleSave = (event) => {
    event.preventDefault(); // 폼 전송 막기

    onSave({
      start: start,
      startday: startday,
      starttime: starttime,
      endday: endday,
      endtime: endtime
    });
  };

  const handleAutocompleteInputChange = (event) => {
    if (autocompleteRef.current) {
      autocompleteRef.current.setFields(["formatted_address", "geometry", "name"]);
      const input = event.target.value;
      autocompleteRef.current.getPlacePredictions(
        { input: input },
        (predictions, status) => {
          if (status === google.maps.places.PlacesServiceStatus.OK && predictions) {
            // You can use the predictions array to show autocomplete dropdown
            console.log(predictions);
            // Update the UI to show the autocomplete dropdown with 'predictions'
          } else {
            // Handle error or clear the autocomplete dropdown
          }
        }
      );
    }
  };

  return (
    <div style={{ display: isOpen ? "block" : "none" }}>
      <div className='modal_background' onClick={closeModal}></div>
      <div className="modal-title">
      </div>
      <div className="Smodal_wrap">
        <div className="modal_textset">
          <form>
            <div className="Smodal-title align-center">일정 추가</div>
            <div className='content-set'>
              <div className='textsets'>
                <div className='input-column-location align-center'>
                  <div className='input-column-text'>장소</div>
                  <div className='input-column-content align-center'>
                    <input
                      className='input-design'
                      name='start'
                      value={start}
                      onChange={(e) => {
                        handleChangeStart(e);
                        handleAutocompleteInputChange(e);
                      }}
                    />
                    <div className='input-result-text'>간사이 국제 공항</div>
                  </div>
                </div>
                {/* ... (The rest of the JSX remains the same) */}
              </div>
              <div className='maps'>
                <div ref={mapRef} id="map"></div>
                <div>
                  <div className="pac-card" id="pac-card">
                    {/* ... (The rest of the JSX remains the same) */}
                  </div>
                  <div id="pac-container">
                    <input
                      id="pac-input"
                      type="text"
                      placeholder="Enter a location"
                      onChange={handleAutocompleteInputChange}
                    />
                  </div>
                </div>
              </div>
            </div>
            <button type="submit" onClick={handleSave}>제출</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default ScheduleItem;
